A continuidade do projeto, com a edição dos volumes 5 e 6 da série, contribuirá significativamente para:

O fortalecimento do perfil acadêmico do PPG-Letras;

A ampliação da visibilidade das produções acadêmicas desenvolvidas no âmbito do programa;

O desenvolvimento e a consolidação da Editora da Unifesp, que sediará a coleção em sua página institucional, ampliando seu acervo digital, seu alcance e sua projeção como editora universitária.

Nesse contexto, a atuação da FapUnifesp é essencial para viabilizar a gestão dos recursos oriundos do PROAP, garantindo a adequada execução financeira e administrativa das atividades previstas, com a devida transparência, conformidade legal e eficiência nos processos.

Tendo em vista o exposto, justifica-se a contratação da FapUnifesp como parceira institucional para a realização deste plano de trabalho, considerando sua capacidade técnica e jurídica para apoiar a execução do projeto e assegurar o cumprimento de seus objetivos acadêmicos e editoriais.
